"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-07-05-welcome/index.md","source":"@site/blog/2024-07-05-welcome/index.md","title":"Welcome","description":"\uc548\ub155\ud558\uc138\uc694!","date":"2024-07-05T00:00:00.000Z","tags":[{"inline":false,"label":"\uc77c\uc0c1","permalink":"/blog/tags/daily","description":"\uc77c\uc0c1 \ud0dc\uadf8 \uad00\ub828 \ud3ec\uc2a4\ud2b8"}],"readingTime":0.31,"hasTruncateMarker":false,"authors":[],"frontMatter":{"slug":"welcome","title":"Welcome","tags":["\uc77c\uc0c1"]},"unlisted":false,"nextItem":{"title":"53\ud68c SQLD \uc2dc\ud5d8 \ud569\uaca9 \ud6c4\uae30","permalink":"/blog/53\ud68c-SQLD-\uc2dc\ud5d8-\ud569\uaca9-\ud6c4\uae30"}},"content":"\uc548\ub155\ud558\uc138\uc694!\\n\\n\uc81c\uac00 \uc88b\uc544\ud558\ub294 \uacf5\ubd80\ub97c \ud558\uba74\uc11c \ubc30\uc6b4 \ub0b4\uc6a9\uc744 \uacf5\uc720\ud558\uae30 \uc704\ud574\uc11c \ub9cc\ub4e0 \ube14\ub85c\uadf8\uc785\ub2c8\ub2e4.\\n\\n\uc8fc\ub85c \ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c, \uc54c\uace0\ub9ac\uc998 \ud480\uc774, \uc77c\uc0c1\uc744 \ud3ec\uc2a4\ud305 \ud560 \uac70\uc5d0\uc694."},{"id":"53\ud68c-SQLD-\uc2dc\ud5d8-\ud569\uaca9-\ud6c4\uae30","metadata":{"permalink":"/blog/53\ud68c-SQLD-\uc2dc\ud5d8-\ud569\uaca9-\ud6c4\uae30","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-06-16-53\ud68c-SQLD-\uc2dc\ud5d8-\ud6c4\uae30/index.mdx","source":"@site/blog/2024-06-16-53\ud68c-SQLD-\uc2dc\ud5d8-\ud6c4\uae30/index.mdx","title":"53\ud68c SQLD \uc2dc\ud5d8 \ud569\uaca9 \ud6c4\uae30","description":"SQLD\ub780?","date":"2024-06-16T00:00:00.000Z","tags":[{"inline":false,"label":"\uc77c\uc0c1","permalink":"/blog/tags/daily","description":"\uc77c\uc0c1 \ud0dc\uadf8 \uad00\ub828 \ud3ec\uc2a4\ud2b8"},{"inline":false,"label":"SQLD","permalink":"/blog/tags/sqld","description":"SQLD \ud0dc\uadf8 \uad00\ub828 \ud3ec\uc2a4\ud2b8"}],"readingTime":3.235,"hasTruncateMarker":false,"authors":[],"frontMatter":{"slug":"53\ud68c-SQLD-\uc2dc\ud5d8-\ud569\uaca9-\ud6c4\uae30","title":"53\ud68c SQLD \uc2dc\ud5d8 \ud569\uaca9 \ud6c4\uae30","tags":["\uc77c\uc0c1","sqld"]},"unlisted":false,"prevItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"## SQLD\ub780?\\n\\nSQLD(Structured Query Language Developer) \uc2dc\ud5d8\uc740 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uad00\ub828 \uc5c5\ubb34\ub97c \uc218\ud589\ud558\ub294 \uac1c\ubc1c\uc790\uc5d0\uac8c \ud544\uc694\ud55c SQL \uc0ac\uc6a9 \ub2a5\ub825\uc744 \uac80\uc99d\ud558\ub294 \uc2dc\ud5d8\uc774\ub2e4.\\n\\n## \uc751\uc2dc \uacc4\uae30\\n\\n\ub9c8\uc9c0\ub9c9 \ud559\uae30 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc218\uc5c5\uc744 \ub4e4\uc73c\uba74\uc11c SQL\uacfc \uad00\ub828\ub41c \uc790\uaca9\uc99d\uc774 \uc788\ub2e4\ub294 \uac83\uc744 \uc54c\uac8c \ub418\uc5c8\ub2e4. \uc218\uc5c5\ub3c4 \ub4e4\uc744\uacb8 \uacb8\uc0ac\uacb8\uc0ac \uc790\uaca9\uc99d\ub3c4 \uac19\uc774 \ub530\uba74 \uc88b\uc744 \uac70 \uac19\uc544 \uc751\uc2dc\ud558\uac8c \ub410\ub2e4.\\n\\n## SQLD \uacf5\ubd80 \ubc29\ubc95\\n\\n\uba3c\uc800 \uac80\uc0c9\uc744 \ud1b5\ud574 SQLD \uc2dc\ud5d8\uc5d0 \ub300\ud55c \uc815\ubcf4\ub97c \ucc3e\uc544\ubcf4\uc558\ub2e4.\\n\\n\ud569\uaca9\ud55c \uc0ac\ub78c\ub4e4\uc758 \uae00\uc758 \uacf5\ud1b5\uc810\uc774 \ub178\ub7ad\uc774\ub97c \uacf5\ubd80\ud588\ub2e4\ub294 \uac83\uc774\ub2e4.\\n\\n\uac1c\ub150 \uacf5\ubd80\ub294 \ud559\uad50 \uacf5\ubd80\uc640 \ud64d\uc324\uc758 SQLD \uac15\uc758\ub97c \ub4e4\uc5c8\ub2e4.\\n\\n\ud64d\uc35c \uac15\uc758\ub294 \uc720\ud29c\ube0c\uc5d0\uc11c \uac15\uc758\uac00 \uacf5\uac1c \ub418\uc5b4 \uc788\uace0, \uac15\uc758 \uad50\uc7ac\ub3c4 \ub124\uc774\ubc84 \uce74\ud398 \uac00\uc785\ud558\uba74 \ubc1b\uc744 \uc218 \uc788\uc5c8\ub2e4.(2024\ub144 5\uc6d4 \uce74\ud398 \uacf5\uc9c0\ub85c \uac15\uc758 \uad50\uc7ac \uc720\ub8cc \uc804\ud658 \uacf5\uc9c0\uac00 \uc62c\ub77c\uc654\ub2e4...)\\n\\n[\ud64d\uc324 \uc720\ud29c\ube0c](https://www.youtube.com/@hdatalab)\\n\\n\uadf8\ub807\uac8c \ud64d\uc35c \ubb34\ub8cc \uac15\uc758 + \ub178\ub7ad\uc774 1\ud68c\ub3c5 \ud558\uace0 \uc2dc\ud5d8\uc744 \ucce4\ub2e4.\\n\\n\uacb0\uacfc\uc801\uc73c\ub85c \ub9d0\ud558\uc790\uba74 \uae30\ucd9c\ub3c4 \uc798 \ucc3e\uc544\ubcf4\uba74 \ubcf5\uc6d0 \ubb38\uc81c\ub4e4\uc774 \uc788\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\uac1c\ub150 \uacf5\ubd80 + \ub178\ub7ad\uc774 \ub2e4\ud68c\ub3c5 + \uae30\ucd9c \ubcf5\uc6d0 = \ubb34\uc801\uc774\ub77c\uace0 \uc0dd\uac01\ud55c\ub2e4.\\n\\n\ub098\ub294 \uc2dc\ud5d8\uc744 \uce58\uace0 \ub098\uc11c \uae30\ucd9c \ubcf5\uc6d0 \ubb38\uc81c\uac00 \uc788\ub2e4\ub294 \uac83\uc744 \uc54c\uac8c \ub410\uace0 \ud6c4\uae30\ub4e4 \uc911\uc5d0\uc11c \uae30\ucd9c\uc5d0\uc11c \ub9ce\uc774 \ub098\uc654\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \ub178\ub7ad\uc774\ub97c \ud480\ub2e4 \ubcf4\uba74 \uae34 sql \ubcf4\uae30\uac00 \uba38\ub9ac\ub97c \uc544\ud504\uac8c \ud558\ub294\ub370 \uadf8\ub7f0 \ubb38\uc81c\ub294 \ud480\uba74 \uc88b\uaca0\uc9c0\ub9cc \ubabb\ud480\uc5b4\ub3c4 \uc88c\uc808\ud558\uc9c0 \uc54a\uc544\ub3c4 \ub41c\ub2e4.\\n\\n\ub178\ub7ad\uc774 \uc790\uccb4\uac00 SQLP \uc2dc\ud5d8\uc790\ub3c4 \ubcf4\ub294 \ucc45\uc774\ub77c\uc11c \uc544\ub9c8 SQLP\uc5d0\uc11c \ub098\uc62c\ub9cc\ud55c \ubb38\uc81c\ub4e4\uc774 \uae34 SQL \ubcf4\uae30\ub4e4\ub85c \ub41c \ubb38\uc81c\uc600\ub358 \uac70 \uac19\ub2e4.\\n\\n\uc2e4\uc81c \uc2dc\ud5d8\uc5d0\uc120 \uae34 SQL \ubcf4\uae30\uac00 \ub098\uc624\uc9c0 \uc54a\uc558\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \ub178\ub7ad\uc774 \ubb38\uc81c\uc640 \ub611\uac19\uc740 \ubb38\uc81c\ub3c4 \ucd9c\uc81c\ub418\uc5c8\ub2e4.\\n\\n## \uc2dc\ud5d8 \ud6c4\uae30\\n\\n\uc2dc\ud5d8 \uc804\ub0a0\uae4c\uc9c0 \uac1c\ub150\uacfc \ub178\ub7ad\uc774 \ud480\uba74\uc11c 100\uc810 \ub9de\ub294 \uc2dc\ud5d8\uc774 \uc544\ub2c8\ub77c 60\uc810\ub9cc \ub118\uae30\uba74 \ub418\ub294 \uc2dc\ud5d8\uc774\ub2e4\ub77c\uace0 \uc0dd\uac01\ud558\uba70 \ud480 \uc218 \uc788\ub294 \ubb38\uc81c\ub97c \ud480\uace0 \ub098\uc624\uc790\ub77c\ub294 \ub9c8\uc778\ub4dc\ub85c \uc2dc\ud5d8\uc744 \ubcf4\ub7ec \uac14\ub2e4.\\n\\n\uc0dd\uac01\ubcf4\ub2e4 \ucc98\uc74c \ubcf4\ub294 \uc720\ud615\uc774 \ub9ce\uc558\uace0, \ubcf4\uae30\uc758 \uae38\uc774\ub294 \uc9e7\uc558\ub2e4.\\n\\n50\ubb38\uc81c\ub97c \ubaa8\ub450 \ud480\uace0 \uac80\ud1a0\uae4c\uc9c0 \ud558\uace0 \ub098\uc624\ub294\ub370 1\uc2dc\uac04 \uc815\ub3c4 \uac78\ub838\ub2e4.\\n\\n\uc2dc\ud5d8 \ubcf8 \ub290\ub08c\uc774 \uc88b\uc558\uace0 \ub2e4\ud589\ud788 \ud569\uaca9\ub3c4 \ud558\uac8c \ub410\ub2e4.\\n\\n![sqld \uc810\uc218](./sqld.png)"}]}}')}}]);